import { Children } from "react";
import styles from "./Header.module.css";

export const Header = ({ children }) => {
  return (
    <div>
      <p>-----------------</p>
      <h1 className={styles.h1}>SEGUNDO H1</h1>
      {Children}
      <p>-----------------</p>
    </div>
  );
};
